def _partially_consume_prefix(self, prefix, column):

    lines = []
    current_line = ""
    current_column = 0
    for char in prefix:
        if char == '\n':
            if current_column < column:
                current_column = 0
                lines.append(current_line + char)
                current_line = ""
            else:
                break
        elif char == ' ':
            current_column += 1
            if current_column <= column:
                current_line += char
            else:
                break
        elif char == '\t':
            current_column += 4
            if current_column <= column:
                current_line += char
            else:
                break
        else:
            current_column += 1
            if current_column <= column:
                current_line += char
            else:
                break

    return ''.join(lines) + current_line, prefix[len(''.join(lines) + current_line):]
